import React from 'react';

function Services() {
  const handleClick = (event) => {
    // Handle click logic here
  };

  return (
    <div>
      <div className="div-block-138">
        <a id="btnNeed" href="#" className="link-block-2 w-inline-block" onClick={handleClick}>
          <div className="div-block-139">
            <div className="text-block-108">Je veux une intervention</div>
            <div className="div-block-272">
              <img src="images/icon_arrow_right_white.png" loading="lazy" width="13" alt="" />
            </div>
          </div>
        </a>
      </div>
    </div>
  );
}

export default Services;
